import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import ListProducts from "./components/Products/ListProducts";
import Products from "./components/Products/Products";

function App() {
    return (
        <div className="app-container">
            <Navbar />
            <Products />
            <ListProducts />
        </div>
    );
}

export default App;
